function onComplete(){clearInterval(domcheck);var t=document.getElementById("loader"),e=[100,200,30,140,40,80,50,60,30,30,30,30];doFlash(t,e,0),setTimeout(function(){randomFlashes(t)},600)}function doFlash(t,e,o){t.style.opacity=1,e.length<=o+1||setTimeout(function(){t.style.opacity=0,setTimeout(function(){doFlash(t,e,o+2)},e[o+1])},e[o])}function randomFlashes(t){setInterval(function(){Math.random()>.5&&(t.style.opacity=0,setTimeout(function(){t.style.opacity=1},60*Math.random()))},100)}var domcheck=setInterval(function(){"complete"===document.readyState&&onComplete()},11);
